literals:
'Please do not specifiy "default" attribute in decorator of "%s" property in "%s" class.  
Default value must be initialized at their declaration: 

// Before:
@property({
  type: cc.Integer
  default: 0  // <--
})
value;
// After:
@property({
  type: cc.Integer
})
value = 0;    // <--'

'Please specifiy a default value for "%s" property at its declaration: 

// Before:
@property(...)
value; 
// After:
@property(...)
value = 0'

'Can not specifiy "get" or "set"  attribute in decorator for "%s" property in "%s" class.  
Please use:

@property(...)
get %s () {
    ...
}
@property
set %s (value) {
    ...
}'

"The value assigned to %s should be Texture2D object, not url string. Since 1.8,  
you can declare a texture object directly in properties by using:  

{
    default: null,
    type: cc.Texture2D  // use 'type:' instead of 'url:'
}"

"

uniform mat4 viewProj;
attribute vec3 a_position;
attribute vec2 a_uv0;
varying vec2 uv0;
void main () {
  vec4 pos = viewProj * vec4(a_position, 1);
  gl_Position = pos;
  uv0 = a_uv0;
}"

"

uniform sampler2D texture;
varying vec2 uv0;
uniform vec4 color;
void main () {
  vec4 c = color * texture2D(texture, uv0);
  float gray = 0.2126*c.r + 0.7152*c.g + 0.0722*c.b;
  gl_FragColor = vec4(gray, gray, gray, c.a);
}"

"

uniform mat4 viewProj;
#ifdef use2DPos
attribute vec2 a_position;
#else
attribute vec3 a_position;
#endif
attribute vec4 a_color;
#ifdef useModel
  uniform mat4 model;
#endif
#ifdef useTexture
  attribute vec2 a_uv0;
  varying vec2 uv0;
#endif
#ifndef useColor
varying lowp vec4 v_fragmentColor;
#endif
void main () {
  mat4 mvp;
  #ifdef useModel
    mvp = viewProj * model;
  #else
    mvp = viewProj;
  #endif
  #ifdef use2DPos
  vec4 pos = mvp * vec4(a_position, 0, 1);
  #else
  vec4 pos = mvp * vec4(a_position, 1);
  #endif
  #ifndef useColor
  v_fragmentColor = a_color;
  #endif
  #ifdef useTexture
    uv0 = a_uv0;
  #endif
  gl_Position = pos;
}"

"

#ifdef useTexture
  uniform sampler2D texture;
  varying vec2 uv0;
#endif
#ifdef alphaTest
  uniform float alphaThreshold;
#endif
#ifdef useColor
  uniform vec4 color;
#else
  varying vec4 v_fragmentColor;
#endif
void main () {
  #ifdef useColor
    vec4 o = color;
  #else
    vec4 o = v_fragmentColor;
  #endif
  #ifdef useTexture
    o *= texture2D(texture, uv0);
  #endif
  #ifdef alphaTest
    if (o.a <= alphaThreshold)
      discard;
  #endif
  gl_FragColor = o;
}"
